class BaseList{constructor(){this._basePath=window.location.pathname;this._table=null}edit(n){this._hasOwnEdit("edit")?this.edit(n):window.location.href=`${this._basePath}/Crud/${n}`}async delete(n){this._hasOwnEdit("delete")?this.delete(n):gLayout.modalDeleteShow(async()=>{try{const t=await gFetch.get(`${this._basePath}/Delete/`,{id:n},FetchUtils.MethodParamType.FromQuery);if(t&&t.HasError)throw new Error(t.Message);this._table.reload();gToast.showSuccess("Item Excluido!")}catch(t){gToast.showDanger(`Error: ${t.message}`)}})}async reactive(n){if(this._hasOwnEdit("reactive"))this.reactive(n);else try{const t=await gFetch.get(`${this._basePath}/Reactive/`,{id:n},FetchUtils.MethodParamType.FromQuery);if(t&&t.HasError)throw new Error(t.Message);this._table.reload();gToast.showSuccess("sucesso!")}catch(t){gToast.showDanger(`Error: ${t.message}`)}}_hasOwnEdit(n){return Object.getPrototypeOf(this).hasOwnProperty(n)}}